import React from "react";
import { useNavigate } from "react-router-dom";
import "../styles/Home.css"; // Import styles
import bananaImage from "../assets/images/wallpaper.jpg"; // Background image

function Home() {
  const navigate = useNavigate();

  return (
    <div className="home-container">
      {/* Overlay to darken background */}
      <div className="overlay"></div>

      {/* Sign Up and Login buttons in the top-right */}
      <div className="auth-buttons">
        <button onClick={() => navigate("/signup")}>Sign Up</button>
        <button onClick={() => navigate("/login")}>Log In</button>
      </div>

      {/* Main content */}
      <div className="content">
        <h1>Welcome to Banana Brain Buster!</h1>
        <p className="game-description">
          Banana Brain Buster is a thrilling math challenge designed to test 
          your problem-solving skills under time pressure! Select a difficulty 
          level and race against the clock to answer as many questions correctly 
          as possible. Keep playing to improve your score and challenge your friends!
        </p>
      </div>
    </div>
  );
}

export default Home;
